import React from 'react';

const CompetitorView = () => {
    const cars = ["Saab", "Volvo", "BMW", "dad"];
  
    return (
        <div className="d-flex justify-content-center align-items-center vh-100 text-primary">
            <div className="bg-black p-5 rounded" style={{ maxWidth: '600px', width: '80%', height: '40%' }}>
                {cars.map((car, index) => (
                    <div key={index}>
                        <h1 className="text-center">{car}</h1>
                    </div>
                ))}
                <h5 className="text-center">Start Date End Date</h5>
                <button className="btn btn-primary d-block mx-auto">Sign Up!</button>
            </div>
        </div>
    );
};

export default CompetitorView;
